import './index.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';


const Nav= () => {
    return (
        <div class="font-extrabold text-left">
            <p>FlavZ</p>
            <div>
                <a href="app.js">Recipies</a>
                <a href="app.js">About Us</a>
                <a href="app.js">Contact</a>
            </div>
            <div>
                <a href="app.js"><FontAwesomeIcon icon="fa-regular fa-magnifying-glass" /></a>
                <a href="app.js"><FontAwesomeIcon icon="fa-duotone fa-bag-shopping" /></a>
                <a href="app.js"><FontAwesomeIcon icon="fa-light fa-user" /></a>
            </div>
        </div>
    )
}
export default Nav;
